import{_ as e,o as r,c as t,O as i}from"./chunks/framework.9482e208.js";const m=JSON.parse('{"title":"§ 9.1-918 Misuse of registry or supplement information; penalty.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/9.1-918.md","filePath":"vacode/9.1-918.md"}'),a={name:"vacode/9.1-918.md"},o=i('<h1 id="§-9-1-918-misuse-of-registry-or-supplement-information-penalty" tabindex="-1">§ 9.1-918 Misuse of registry or supplement information; penalty. <a class="header-anchor" href="#§-9-1-918-misuse-of-registry-or-supplement-information-penalty" aria-label="Permalink to &quot;§ 9.1-918 Misuse of registry or supplement information; penalty.&quot;">​</a></h1><p>Use of registry information or information from the Supplement to the Registry established pursuant to § <a href="/vacode/9.1-923/">9.1-923</a> for purposes not authorized by this chapter is prohibited, the unlawful use of the information contained in or derived from the Registry or Supplement for purposes of intimidating or harassing another is prohibited, and a willful violation of this chapter is a Class 1 misdemeanor. For purposes of this section, absent other aggravating circumstances, the mere republication or reasonable distribution of material contained on or derived from the publicly available Internet offender database shall not be deemed intimidation or harassment.</p><p>2003, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?031+ful+CHAP0584" target="_blank" rel="noreferrer">584</a>; 2006, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?061+ful+CHAP0857" target="_blank" rel="noreferrer">857</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?061+ful+CHAP0914" target="_blank" rel="noreferrer">914</a>; 2015, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?151+ful+CHAP0594" target="_blank" rel="noreferrer">594</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?151+ful+CHAP0603" target="_blank" rel="noreferrer">603</a>; 2020, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?201+ful+CHAP0829" target="_blank" rel="noreferrer">829</a>.</p>',3),n=[o];function s(l,p,f,c,h,g){return r(),t("div",null,n)}const u=e(a,[["render",s]]);export{m as __pageData,u as default};
